        this.fv_timerMax = 30;
        this.fv_curtime = 0;
        this.poc01_ontimer = function(obj,e)
        {
        	var nValue ;
        	var obj = this.Div00.form.Button00;

        	switch(e.timerid)
        	{
        		case 1://열기
        			nValue = this.fnMoveAnimation(this.fv_curtime, 0, (this.fv_open_detail_height - this.fv_close_detail_height), this.fv_timerMax) + this.fv_close_detail_height;
        			this.fv_curtime = this.fv_curtime + 1;

        			this.Div00.setOffsetHeight(nValue);

        			if(this.fv_curtime==this.fv_timerMax)
        			{
        				this.killTimer(1);
        				this.fv_curtime = 0;
        			}
        			break;

        		case 2://닫기
        			nValue = this.fnMoveAnimation(this.fv_curtime, 0,  (this.fv_open_detail_height - this.fv_close_detail_height), this.fv_timerMax);
        			this.fv_curtime = this.fv_curtime + 1;

        			this.Div00.setOffsetHeight(this.fv_open_detail_height - nValue);

        			if(this.fv_curtime==this.fv_timerMax)
        			{
        				this.killTimer(2);
        				this.fv_curtime = 0;
        				obj.set_cssclass("btn_toggle_up");
        			}
        			break;

        		case 99:
        			//일정시간 지나면 푸쉬
        //			this.Grid00.blinkCell(5, 5, 10000, 10);
        			//신뢰성에 사용? 푸쉬를 받을 준비를 한다.
        			this.killTimer(99);
        			break;
        	}
        };

        /**
        * fnMoveAnimation : 애니메이션 Interpolation 함수
        * @param {Number}  t	- current time(time or frame)
        * @param {Number}  b	- start value
        * @param {Number}  c	- change between the beginning and destination of the property
        * @param {Number}  d	- duration (time or frame)
        * @return : 위치값
        * @example :
        */
        this.fnMoveAnimation = function (t, b, c, d)
        {
        	t /= d/2;
        	if (t < 1) return c/2*t*t*t + b;
        	t -= 2;
        	return c/2*(t*t*t + 2) + b;
        };



