        //팝업 콜백
        this.fn_popCallback = function(sPopupId , vRtn, pop)
        {
        	switch(sPopupId)
        	{
        		 case "ViewFilter":
        			var objDs = vRtn;
        			var sCond = "";
        			//정렬하고 넣어야 할거 같은딩 ㅠ ITEM먼저
        			if(objDs instanceof Dataset)
        			{
        				this.dsGrdHeader.clearData();
        				this.edtViewFilter.set_value("");
        				for(var i = 0 ; i < objDs.rowcount; i++)
        				{
        					nRow = this.dsGrdHeader.addRow();
        					this.dsGrdHeader.copyRow(nRow, objDs, i, "header=code,bindColumn=code,group=group,coSize=coSize,textAlign=textAlign");
        					sCond += objDs.getColumn(i, "code") + ", ";
        				}
        				this.dsGrdHeader.applyChange() ;
        				//this.dsGrdHeader.set_keystring("S:-coSize");
        				sCond = sCond.substr(0, sCond.length -2);
        				this.edtViewFilter.set_value(sCond);
        				pop.close();
        			}
        			break;

        		case "DataFilter":
        			var objDs = vRtn;
        			this.edtDataFilter.set_value("");
        			if(objDs instanceof Dataset)
        			{
        // 				if(objDs.getColumn(0, "All") == true)
        // 				{
        // 					this.dsGrid.copyData(this.dsGridOrigin);
        // 					return;
        // 				}

        				//number , discription, nominator를 각각 filter를 건다. 조건에 맞는걸 넣어준다...?
        				var nRow = -1;
        				var sColNm = "";
        				var sString = "";
        				//this.dsGrid.clearData();
        				this.dsGridOrigin00.clearData();
        				this.edtDataFilter.set_value("");

        				for(var i = 0 ; i < objDs.colcount ;i++)
        				{
        					if(objDs.getColumn(0, i) == undefined || objDs.getColumn(0, i)==null || objDs.getColumn(0, i) == "" ||  objDs.getColumn(0, i) == "false" ) continue;
        					sColNm = String(objDs.getColID(i));
        					this.dsGridOrigin.filter("");
        					if(sColNm.indexOf("nomi_") > -1)
        					{
        						var temp = sColNm.replace("nomi_", "");
        						this.dsGridOrigin.filter("Description.indexOf('" +  temp+ "') > -1");
        						sString += temp + ", ";
        					}
        					else if(sColNm.indexOf("des_") > -1)
        					{
        						var temp = nexacro.replaceAll(sColNm, "des_", "");
        							temp = nexacro.trim(temp, " ");

        						this.dsGridOrigin.filter("Nominator.indexOf('" + temp + "') > -1");
        						sString += temp + ", ";
        					}
        					else
        					{
        						this.dsGridOrigin.filter("Number.indexOf('" + sColNm + "') > -1");
        						sString += sColNm + ", ";
        						//CX
        	// 					if(objDs.getColumn(i,"FROM") != null && objDs.getColumn(i,"FROM") !="" && objDs.getColumn(i,"FROM") != undefined
        	// 						&&
        	// 					   objDs.getColumn(i,"TO") != null && objDs.getColumn(i,"TO") !="" && objDs.getColumn(i,"TO") != undefined)
        					}
        					this.dsGridOrigin00.appendData(this.dsGridOrigin, true, true);
        				}
        				sString = sString.substr(0, sString.length -2);
        				this.edtDataFilter.set_value(sString);


        				pop.close();
        			}
        			break;
        	}
        }


